    <style>ipl-progress-indicator {
        opacity: 1;
        pointer-events: none;
        transition: opacity cubic-bezier(.4, 0, .2, 1) 436ms;
        z-index: 9999;
    }

    ipl-progress-indicator.hide {
        opacity: 0;
    }

    ipl-progress-indicator & gt

    ;
    .play-logo-frame {
        display: flex;
        flex-direction: column;
        justify-content: center;
        animation: fadein 436ms;
        height: 98%;
    }

    ipl-progress-indicator .play-logo {
        align-self: center;
    }

    @keyframes fadein {
        from {
            opacity: 0;
        }
        to {
            opacity: 1;
        }
    }

    ipl-progress-indicator .first-indicator, ipl-progress-indicator .second-indicator {
        background-color: #4285f4;
        bottom: 0;
        left: 0;
        right: 0;
        top: 0;
        position: absolute;
        transform-origin: left center;
        transform: scaleX(0);
    }

    ipl-progress-indicator .first-indicator {
        animation: first-indicator 4s linear infinite;
    }

    ipl-progress-indicator .second-indicator {
        animation: second-indicator 4s linear infinite;
    }

    @keyframes first-indicator {
        0% {
            transform: translateX(-20%) scaleX(.2);
        }
        75% {
            transform: translateX(100%) scaleX(.90);
        }
        100% {
            transform: translateX(100%) scaleX(.90);
        }
    }

    @keyframes second-indicator {
        0% {
            transform: translateX(0) scaleX(0);
        }
        65% {
            transform: translateX(-90%) scaleX(.90);
        }
        95% {
            transform: translateX(120%) scaleX(.2);
        }
        100% {
            transform: translateX(100%) scaleX(.2);
        }
    }</style>
